  imageSize: 90,
};

export default function Profile() {
  return (
    //markup
    <> 
      <h1>{user.name}</h1>
      <img
        className="avatar"
        src={user.imageUrl}
        alt={'Foto ' + user.name}
        style={{
          width: user.imageSize,
          height: user.imageSize
        }}
      />
    </>//markup
  );
}
